class Solution:
    def maxOperations(self, s: str) -> int:
        n = len(s)        
        ones = [i for i in range(n) if s[i] == '1']
        ones.append(n)
        ans = 0
        for i in range(len(ones) - 1, 0, -1):
            if ones[i] - ones[i - 1] != 1:
                ans += i
        return ans
